  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Presquile
  and James River National Wildlife Refuges outlines Refuge accomplishments during
  the 2006 fiscal year. Land acquisition is covered. The report includes a planning
  section which discusses public participation, compliance with environmental and
  cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel and volunteer programs is given. Habitat
  management is also covered; subjects include forests, grasslands, fire management,
  pest control, and water rights. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, and game mammals. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, wildlife observation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, and equipment replacement. Cooperative programs and items of
  interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
